That's a really good point.  But what if we handled it by having a PA function like this:

pa_Kdf(salt, keySize, bufPtr, bufSize);

The PA would run some KDF function with its hardware secret key to generate a key for the core code.  The core code would then use this function to get the name key like this:

pa_Kdf("NameKey", 32, buf, sizeof(buf));

This way the code that does the item name MACing can remain in the core code but the name key does not need to be stored.  In fact, we can do the same thing for the Root Protection Key which will allow us to pull the encryption of the files out of the PA as well.

What do you think?
